  return (
    <div className="profile-card">
      {/* Display user's picture */}
      <div className="user-picture">
        <img src={user.avatar} alt={user.name} />
      </div>

      {/* Display user information */}
      <div className="user-info">
        <h2>{user.name}</h2>
        <p>{user.bio}</p>
      </div>

      {/* Rest of the card */}
      {/* ... */}
    </div>
  );
}

export default ProfileCard;
